class ApiVersioning:
    def __init__(self):
        self.versions = {}

    def add_version(self, version, api):
        self.versions[version] = api

    def get_version(self, version):
        return self.versions.get(version)

    def get_latest_version(self):
        return max(self.versions, key=self.versions.get)

    def get_all_versions(self):
        return self.versions.keys()

class EdenClient:
    def __init__(self):
        self.api_versioning = ApiVersioning()

    def set_api_version(self, version, api):
        self.api_versioning.add_version(version, api)

    def get_api_version(self, version):
        return self.api_versioning.get_version(version)

    def get_latest_api_version(self):
        return self.api_versioning.get_latest_version()

    def get_all_api_versions(self):
        return self.api_versioning.get_all_versions()

# Example usage
eden_client = EdenClient()
eden_client.set_api_version('v1', 'http://v1.api.com')
eden_client.set_api_version('v2', 'http://v2.api.com')
print(eden_client.get_api_version('v1'))  # Output: http://v1.api.com
print(eden_client.get_latest_api_version())  # Output: v2
print(eden_client.get_all_api_versions())  # Output: ['v1', 'v2']
